    Message,
    Menu,
    Modal,
    Dropdown,
    Label,
    Container
} from 'semantic-ui-react';

export default class SignIn extends Component {
render() {
    return (
        <Button as='div' labelPosition='right' >
        <Button >
          <Icon  name='heart' />
          Like
        </Button>
        <Label as='a' basic color='red' pointing='left'>
          2,048
        </Label>
      </Button>

    )
    }
}
